import React from 'react';
import '../CSS/home.css'; // Import the CSS for styling
import backgroundImage from './your-background.jpg'; // Make sure to replace 'your-background.jpg' with your actual image file

function LandingPage() {
    return (
        <div className="landing-page" style={{ backgroundImage: `url(${backgroundImage})` }}>
            <div className="text-overlay">
                <h1>Welcome to Our Website</h1>
                <p>Explore and discover our services.</p>
            </div>
        </div>
    );
}

export default LandingPage;
